import React, { Component } from "react";
import { Alert, Card, Grid, StatsCard } from 'tabler-react';
import C3Chart from "react-c3js";
import 'c3/c3.css';
import './Dashboard.scss';

const data = {
    x: 'x',
    xFormat: '%Y-%m-%d',
    columns: [
        ['x', '2013-01-01', '2013-01-02', '2013-01-03', '2013-01-04', '2013-01-05', '2013-01-06'],
        ['data1', 30, 200, 100, 400, 150, 250],
        ['data2', 130, 340, 200, 500, 250, 350]
    ],
};

const axis = {
    x: {
        type: 'timeseries',
        tick: {
            format: '%Y-%m-%d'
        }
    }
};

class Overview extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="dashboard">
                <div className="mainchart">
                    <Card
                        title="Wallet Value"
                        body={
                            <C3Chart data={data} axis={axis} />
                        }
                    />
                </div>

                <Card
                    title="Stats"
                    body={
                        <div className="substats">
                            <Grid.Row cards>
                                <Grid.Col>
                                    <StatsCard layout={2} movement={5} total={30583 + "$"} label="USD/BTC" />
                                </Grid.Col>
                                <Grid.Col>
                                    <StatsCard layout={2} total={42384 + "$"} label="Wallet Value" />
                                </Grid.Col>
                                <Grid.Col>
                                    <StatsCard layout={2} total="1.72542" label="Total BTC" />
                                </Grid.Col>
                            </Grid.Row>
                        </div>
                    }
                />
            </div>
        )
    }
}

export default Overview;
